import React, { Component } from 'react';
import Link from 'next/link';
import logo from '../static/logo.png';
import search from '../static/search.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardText, CardHeader, CardBody, Button } from 'reactstrap';

class Header extends Component{

    render(){
        return(

            <div >
                <nav className = 'navbar'>
                    <div className = 'container-fluid'>
                    <Logo/>
                    <SearchBox/>
                    <Menu/>
                    </div>
                </nav>

                <style jsx>{`
                    div{
                        background: #004650;
                    }
                    img{
                        width: 40px;
                        height: 40px;
                        background: #004650;
                    }
                `}</style>
            </div>
        );
    }
}

const Logo = props => (
    <div className = 'navbar-header'>
        <Link href = '#'>
            <a className = 'navbar-brand'>
                        <img src={logo} alt = 'logo'/>
            </a>
        </Link>
        <style jsx>{`


                `}</style>


    </div>
);

const MenuButton = props =>(
    <Link href = {`${props.href}`}>
        <li className = 'nav-item'><a className = 'nav-link'>{`${props.name}`}</a></li> 
    </Link>
);

const Menu = props =>(
    <ul className = 'nav'>
        <MenuButton name = 'Main' href = '#'/>
        <MenuButton name = 'Songs' href = '#'/>
        <MenuButton name = 'Compositors' href = '#'/>
        <MenuButton name = 'Chords' href = '#'/>
        <MenuButton name = 'Articles' href = '#'/>
    </ul>


);

const SearchBox = props =>(
    <div class="col-md-6 col-md-offset-3">
        <div class="input-group"> 
            <input type="text" class="form-control" name="x" placeholder="Search term..."/>
            <span class="input-group-btn">
                <button class="btn btn-default" type="button"><span class="glyphicon glyphicon-search"></span><img src={search} alt = 'search'/></button>
                <style>{``}</style>
            </span>
        </div> 
    </div>

);

export default Header;
